import React from 'react';
import { Link } from "react-router-dom";



const LinkButton = () => {
  return (
    <div>
    <Link  to="/signup">Get Started</Link>
    <Link className="link-login" to="/login">Login</Link>

    </div>
  )
}

export default LinkButton;
